import React from 'react';

class Tile extends React.Component {
	constructor(props) {
		super(props);
		Tile.instances.push(this);
	}

	render() {
		return(
			<div className='tile'
				style={{
					width: `${Tile.size}px`,
					height: `${Tile.size}px`
				}}
			></div>
			);
	}
}


Tile.instances = [];
Tile.size = 100;

export default Tile;
